import React from 'react';
import Grid from '@mui/material/Unstable_Grid2';
import Typography from '@mui/material/Typography';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import theme from './theme';
import {
  CardActionArea,
  Button,
  TextField,
  ButtonGroup,
  ListItem,
  ListItemAvatar,
  Avatar,
  ListItemText,
  Rating,
  Container,
  useScrollTrigger,
  Fade,
  Box,
  Fab,
} from '@mui/material';

import SearchIcon from '@mui/icons-material/Search';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';

import { useNavigate } from 'react-router-dom';
import Footer from './footer';

const CourseCard = ({ image, author, authorIcon, title, rating }) => {
  const navigate = useNavigate();
  return (
    <Card
      variant='outlined'
      sx={{ borderRadius: '1rem', borderColor: theme.palette.primary.main }}
      onClick={() => navigate('course')}
    >
      <CardActionArea>
        <CardMedia component='img' image={image} sx={{ borderRadius: '1.5rem', padding: '.7rem' }} />
        <CardContent sx={{ padding: '0.7rem' }}>
          <ListItem button sx={{ paddingX: 0 }}>
            <ListItemAvatar>
              <Avatar alt='Profile Picture' src={authorIcon} />
            </ListItemAvatar>
            <ListItemText sx={{ color: 'grey' }} primary={author} />
          </ListItem>
          <Typography>{title}</Typography>
          <Grid container alignItems='center'>
            <Rating size='small' value={rating} readOnly />
            <Grid xs>
              <Typography align='right' component='legend'>
                Rating
              </Typography>
            </Grid>
          </Grid>
        </CardContent>
      </CardActionArea>
    </Card>
  );
};

function ScrollTop(props) {
  const { children, window } = props;
  // Note that you normally won't need to set the window ref as useScrollTrigger
  // will default to window.
  // This is only being set here because the demo is in an iframe.
  const trigger = useScrollTrigger({
    target: window ? window() : undefined,
    disableHysteresis: true,
    threshold: 100,
  });

  const handleClick = (event) => {
    const anchor = (event.target.ownerDocument || document).querySelector('#back-to-top-anchor');

    if (anchor) {
      anchor.scrollIntoView({
        block: 'center',
      });
    }
  };

  return (
    <Fade in={trigger}>
      <Box onClick={handleClick} role='presentation' sx={{ position: 'fixed', bottom: 16, right: 16 }}>
        {children}
      </Box>
    </Fade>
  );
}

const Home = (props) => {
  const navigate = useNavigate();
  return (
    <Container>
      <Grid container justifyContent={'center'} mt={2}>
        <Grid xs={8}>
          <TextField id='1' label='' variant='outlined' color='primary' size='small' sx={{ width: '100%' }} />
        </Grid>
        <Grid sm={1}>
          <Button color='primary' aria-label='upload picture' component='label' variant='outlined' size='large'>
            <SearchIcon />
          </Button>
        </Grid>
      </Grid>
      <Grid container spacing={3} style={{ margin: '1rem' }}>
        {courses.map((data, index) => (
          <Grid xs={12} sm={6} md={4} key={index}>
            <CourseCard {...data} />
          </Grid>
        ))}
      </Grid>
      {/* scroll to top button */}
      <ScrollTop {...props}>
        <Fab size='small' aria-label='scroll back to top' color='primary'>
          <KeyboardArrowUpIcon />
        </Fab>
      </ScrollTop>

      <ButtonGroup variant='outlined' color='primary' aria-label='' sx={{ display: 'flex', justifyContent: 'center' }}>
        <Button>1</Button>
        <Button>2</Button>
      </ButtonGroup>
      <Footer />
    </Container>
  );
};
export default Home;

const courses = [
  {
    author: 'Jason Willams',
    title: 'Data Science and Machine Learning with Python -Hands On!',
    image: 'images/courses-01.jpg',
    authorIcon: 'images/author-01.jpg',
    rating: 4,
  },
  {
    author: 'Pamella Foster',
    title: 'Create Amazing Color Schemes for Your UX Design Projects',
    image: 'images/courses-02.jpg',
    authorIcon: 'images/author-02.jpg',
    rating: 5,
  },
  {
    author: 'Rose Simmons',
    title: 'Culture & Leadership: Strategies for a Successful Business',
    image: 'images/courses-02.jpg',
    authorIcon: 'images/author-02.jpg',
    rating: 3,
  },
  {
    author: 'Anna Maria',
    title: 'Finance Series: Learn to Budget and Calculate your Net Worth.',
    image: 'images/courses-02.jpg',
    authorIcon: 'images/author-02.jpg',
    rating: 4,
  },
];
